import React from 'react'

export default class FileForm extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div>
                <input type="text" className="form-control" name="fileName" placeholder="Enter fileName"/>
                <button type="submit" className="btn btn-info custom-button" onClick="">Load text</button>
            </div>
        )
    }

}
